import React from 'react';
import Iframe from 'react-iframe';

import artmatch_728x90 from '../banners/ArtMatch/artmatch_728x90.html';

export default class BannerCollection extends React.Component {
	render() {
        //let data = this.props.data;
		return (
			<section fluid="true" className="intro text-light ml-4 mr-4 pl-4 pr-4 pt-3 pb-1" >
                <h1>Animated Banners</h1>
                <p>HTML5 banners for desktop, animated with GSAP.</p>
                <Iframe url={artmatch_728x90}
                    width="450px"
                    height="450px"
                    id="myId"
                    className="myClassname"
                    display="initial"
                    position="relative"
                    allowFullScreen/>
                <Iframe title="ArtMatch" src="../banners/ArtMatch/artmatch_728x90.html" width="728px" height="90px" frameBorder="0" scrolling="no" />
            </section>
		)
	}
}
